import React, { Component } from 'react';
import { searchAllModels } from './services/apiService';
import './App.css';

class App extends Component {
    render() {
        searchAllModels('spider').then(res => res.json()).then((searchResponse) => {
            console.log(searchResponse);
        });

        return (
            <div className="App">
                <header className="App-header">
                    <img
                        src={"https://static.sketchfab.com/img/press/logos/logo.png"}
                        className="App-logo"
                        alt="logo"
                    />
                    <p>
                        Welcome to the <code>Tech/Frontend</code> exercise.
              </p>
                </header>
            </div>
        );
    }
}

export default App;
